import{_ as s,c as a,o as n,O as l}from"./chunks/framework.0d343703.js";const D=JSON.parse('{"title":"js的数据类型概述","description":"","frontmatter":{"title":"js的数据类型概述","date":"2021-08-25T15:45:00.000Z","summary":"js数据类型，个人认为理解其真正内核是学习的基础。","tags":["js"]},"headers":[],"relativePath":"technology/js的数据类型概述.md"}'),e={name:"technology/js的数据类型概述.md"},p=l(`<h1 id="js的数据类型概述" tabindex="-1">js的数据类型概述 <a class="header-anchor" href="#js的数据类型概述" aria-label="Permalink to &quot;js的数据类型概述&quot;">​</a></h1><h2 id="一、简介" tabindex="-1">一、简介 <a class="header-anchor" href="#一、简介" aria-label="Permalink to &quot;一、简介&quot;">​</a></h2><ul><li><p>数值（number）：整数和小数（比如<code>1</code>和<code>3.14</code>）</p></li><li><p>字符串（string）：文本（比如<code>Hello World</code>）。</p></li><li><p>布尔值（boolean）：表示真伪的两个特殊值，即<code>true</code>（真）和<code>false</code>（假）</p></li><li><p><code>undefined</code>：表示“未定义”或不存在，即由于目前没有定义，所以此处暂时没有任何值</p></li><li><p><code>null</code>：表示空值，即此处的值为空。</p></li><li><p>对象（object）：各种值组成的集合。</p><p>注1:</p><p>ES6新增了第七种Symbol类型&quot;<a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Symbol" target="_blank" rel="noreferrer">https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/Symbol</a>&quot;，前三种数据类型称为原始类型</p><p>注2:</p><p>对象可分为三个子类型(对象可以看成原始类型数据值的合成，类似于容器)</p><ul><li>狭义的对象（object）</li><li>数组（array）</li><li>函数（function）</li></ul></li></ul><h2 id="二、typeof-运算符" tabindex="-1">二、typeof 运算符 <a class="header-anchor" href="#二、typeof-运算符" aria-label="Permalink to &quot;二、typeof 运算符&quot;">​</a></h2><p>​ JS确定数据的基本类型有以下三种方法：</p><ul><li><p><code>typeof</code>运算符：返回一个值的数据类型</p></li><li><p><code>instanceof</code>运算符</p></li><li><p><code>Object.prototype.toString</code>方法</p><p>注：<code>typeof null </code>//&quot;object&quot;</p><p>原因：由于历史原因造成的。1995年的 JavaScript 语言第一版，只设计了五种数据类型（对象、整数、浮点数、字符串和布尔值），没考虑<code>null</code>，只把它当作<code>object</code>的一种特殊值。后来<code>null</code>独立出来，作为一种单独的数据类型，为了兼容以前的代码，<code>typeof null</code>返回<code>object</code>就没法改变了。</p></li></ul><h2 id="三、null-和-undefined" tabindex="-1">三、null 和 undefined <a class="header-anchor" href="#三、null-和-undefined" aria-label="Permalink to &quot;三、null 和 undefined&quot;">​</a></h2><p>​ **null表示&quot;没有对象&quot;，即该处不应该有值。**典型用法是：</p><blockquote><p>（1） 作为函数的参数，表示该函数的参数不是对象。</p><p>（2） 作为对象原型链的终点。</p></blockquote><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">Object</span><span style="color:#89DDFF;">.</span><span style="color:#82AAFF;">getPrototypeOf</span><span style="color:#A6ACCD;">(</span><span style="color:#FFCB6B;">Object</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">prototype)</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// null</span></span></code></pre></div><p>​ **undefined表示&quot;缺少值&quot;，就是此处应该有一个值，但是还没有定义。**典型用法是：</p><blockquote><p>（1）变量被声明了，但没有赋值时，就等于undefined。</p><p>（2) 调用函数时，应该提供的参数没有提供，该参数等于undefined。</p><p>（3）对象没有赋值的属性，该属性的值为undefined。</p><p>（4）函数没有返回值时，默认返回undefined。</p></blockquote><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">var</span><span style="color:#A6ACCD;"> i</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">i </span><span style="color:#676E95;font-style:italic;">// undefined</span></span>
<span class="line"></span>
<span class="line"><span style="color:#C792EA;">function</span><span style="color:#A6ACCD;"> </span><span style="color:#82AAFF;">f</span><span style="color:#89DDFF;">(</span><span style="color:#A6ACCD;font-style:italic;">x</span><span style="color:#89DDFF;">){</span><span style="color:#A6ACCD;">console</span><span style="color:#89DDFF;">.</span><span style="color:#82AAFF;">log</span><span style="color:#F07178;">(</span><span style="color:#A6ACCD;">x</span><span style="color:#F07178;">)</span><span style="color:#89DDFF;">}</span></span>
<span class="line"><span style="color:#82AAFF;">f</span><span style="color:#A6ACCD;">() </span><span style="color:#676E95;font-style:italic;">// undefined</span></span>
<span class="line"></span>
<span class="line"><span style="color:#C792EA;">var</span><span style="color:#A6ACCD;">  o </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">new</span><span style="color:#A6ACCD;"> </span><span style="color:#82AAFF;">Object</span><span style="color:#A6ACCD;">()</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">o</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">p </span><span style="color:#676E95;font-style:italic;">// undefined</span></span>
<span class="line"></span>
<span class="line"><span style="color:#C792EA;">var</span><span style="color:#A6ACCD;"> x </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#82AAFF;">f</span><span style="color:#A6ACCD;">()</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">x </span><span style="color:#676E95;font-style:italic;">// undefined</span></span></code></pre></div><h2 id="四、布尔值" tabindex="-1">四、布尔值 <a class="header-anchor" href="#四、布尔值" aria-label="Permalink to &quot;四、布尔值&quot;">​</a></h2><p>​ 布尔值只有“true”和“false”的两个状态。</p><p>​ 下列运算符会返回布尔值：</p><ul><li>前置逻辑运算符： <code>!</code> (Not)</li><li>相等运算符：<code>===</code>，<code>!==</code>，<code>==</code>，<code>!=</code></li><li>比较运算符：<code>&gt;</code>，<code>&gt;=</code>，<code>&lt;</code>，<code>&lt;=</code></li></ul><p>如果 JavaScript 预期某个位置应该是布尔值，会将该位置上现有的值自动转为布尔值。转换规则是除了下面六个值被转为<code>false</code>，其他值都视为<code>true</code>。</p><ul><li><p><code>undefined</code></p></li><li><p><code>null</code></p></li><li><p><code>false</code></p></li><li><p><code>0</code></p></li><li><p><code>NaN</code></p></li><li><p><code>&quot;&quot;</code>或<code>&#39;&#39;</code>（空字符串）</p><p>注：空字符串对应布尔值false。</p><p>​ 空数组、对象对应布尔值true。</p></li></ul><h2 id="五、数值" tabindex="-1">五、数值 <a class="header-anchor" href="#五、数值" aria-label="Permalink to &quot;五、数值&quot;">​</a></h2><p>​ JS语言的底层数字皆以64位浮点数存储。</p><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">===</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">1.0</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">//true</span></span>
<span class="line"></span>
<span class="line"><span style="color:#F78C6C;">0.1</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">+</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">0.2</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">===</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">0.3</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// false</span></span>
<span class="line"></span>
<span class="line"><span style="color:#F78C6C;">0.3</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">/</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">0.1</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// 2.9999999999999996</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">(</span><span style="color:#F78C6C;">0.3</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">0.2</span><span style="color:#A6ACCD;">) </span><span style="color:#89DDFF;">===</span><span style="color:#A6ACCD;"> (</span><span style="color:#F78C6C;">0.2</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">-</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">0.1</span><span style="color:#A6ACCD;">)</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// false</span></span></code></pre></div><ul><li><p>范围：</p><p>根据标准，64位浮点数的指数部分的长度是11个二进制位，意味着指数部分的最大值是2047（2的11次方减1）。也就是说，64位浮点数的指数部分的值最大为2047，分出一半表示负数，则 JavaScript 能够表示的数值范围为2-1024到2-1023次方（开区间），超出这个范围的数无法表示。</p><p>(0-&gt;Infinity)</p><p>JavaScript 提供<code>Number</code>对象的<code>MAX_VALUE</code>和<code>MIN_VALUE</code>属性，返回可以表示的具体的最大值和最小值。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var x = 0.5;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">for(var i = 0; i &lt; 25; i++) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  x = x * x;</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">x// 0</span></span></code></pre></div></li><li><p>特殊值：</p><p>1.正零和负零</p><p>几乎是等价的，唯一区别<code>+0</code>或<code>-0</code>当作分母，返回的值是不相等的。</p><p><code>(1 / +0) === (1 / -0) // false</code></p><p>原因：除以正零得到<code>+Infinity</code>，除以负零得到<code>-Infinity</code>，这两者是不相等的。</p><p>2.NaN(Not a Number)</p><p>表示“非数字”，主要出现在将字符串解析成数字出错的场合。</p><p><code>NaN</code>不等于任何值，包括它本身。</p><p><code>NaN === NaN </code> //false</p><p>数组的<code>indexOf</code>方法内部使用的是严格相等运算符，所以该方法对<code>NaN</code>不成立。</p><p><code>[NaN].indexOf(NaN) // -1</code></p><p><code>NaN</code>在布尔运算时被当作<code>false</code>。</p><p><code>Boolean(NaN) // false</code></p><p><code>NaN</code>与任何数（包括它自己）的运算，得到的都是<code>NaN</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">NaN + 32 // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">NaN - 32 // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">NaN * 32 // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">NaN / 32 // NaN</span></span></code></pre></div><p>3.Infinity</p><p>1.表示无穷。数值太大或太小无法表示，另一种是非0数值除以0，得到Infinity。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">// 场景一</span></span>
<span class="line"><span style="color:#A6ACCD;">Math.pow(2, 1024)</span></span>
<span class="line"><span style="color:#A6ACCD;">// Infinity</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 场景二</span></span>
<span class="line"><span style="color:#A6ACCD;">0 / 0 // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">1 / 0 // Infinity</span></span></code></pre></div><p>2.Infinity有正负之分，<code>Infinity</code>表示正的无穷，<code>-Infinity</code>表示负的无穷。</p><p>3.<code>Infinity</code>大于一切数值（除了<code>NaN</code>），<code>-Infinity</code>小于一切数值（除了<code>NaN</code>）。</p><p>4.<code>Infinity</code>与<code>NaN</code>比较，总是返回<code>false</code>。</p><p>4.方法：</p></li></ul><h3 id="_1-parseint" tabindex="-1">1.parseInt() <a class="header-anchor" href="#_1-parseint" aria-label="Permalink to &quot;1.parseInt()&quot;">​</a></h3><p>将字符串转为数值。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;123&#39;) // 123</span></span></code></pre></div><p>如果字符串头部有空格，空格会被自动去除。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;   81&#39;) // 81</span></span></code></pre></div><p>如果<code>parseInt</code>的参数不是字符串，则会先转为字符串再转换。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(1.23) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;1.23&#39;) // 1</span></span></code></pre></div><p>字符串转为整数的时候，是一个个字符依次转换，如果遇到不能转为数字的字符，就不再进行下去，返回已经转好的部分。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;8a&#39;) // 8</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;12**&#39;) // 12</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;12.34&#39;) // 12</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;15e2&#39;) // 15</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;15px&#39;) // 15</span></span></code></pre></div><p>上面代码中，<code>parseInt</code>的参数都是字符串，结果只返回字符串头部可以转为数字的部分。</p><p>如果字符串的第一个字符不能转化为数字（后面跟着数字的正负号除外），返回<code>NaN</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;abc&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;.3&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;+&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;+1&#39;) // 1</span></span></code></pre></div><p>所以，<code>parseInt</code>的返回值只有两种可能，要么是一个十进制整数，要么是<code>NaN</code>。</p><p>如果字符串以<code>0x</code>或<code>0X</code>开头，<code>parseInt</code>会将其按照十六进制数解析。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;0x10&#39;) // 16</span></span></code></pre></div><p>如果字符串以<code>0</code>开头，将其按照10进制解析。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;011&#39;) // 11</span></span></code></pre></div><p>对于那些会自动转为科学计数法的数字，<code>parseInt</code>会将科学计数法的表示方法视为字符串，因此导致一些奇怪的结果。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(1000000000000000000000.5) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;1e+21&#39;) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(0.0000008) // 8</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;8e-7&#39;) // 8</span></span></code></pre></div><p><strong>（2）进制转换</strong></p><p><code>parseInt</code>方法还可以接受第二个参数（2到36之间），表示被解析的值的进制，返回该值对应的十进制数。默认情况下，<code>parseInt</code>的第二个参数为10，即默认是十进制转十进制。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;1000&#39;) // 1000</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;1000&#39;, 10) // 1000</span></span></code></pre></div><p>下面是转换指定进制的数的例子。</p><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#82AAFF;">parseInt</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">1000</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">2</span><span style="color:#A6ACCD;">) </span><span style="color:#676E95;font-style:italic;">// 8</span></span>
<span class="line"><span style="color:#82AAFF;">parseInt</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">1000</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">6</span><span style="color:#A6ACCD;">) </span><span style="color:#676E95;font-style:italic;">// 216</span></span>
<span class="line"><span style="color:#82AAFF;">parseInt</span><span style="color:#A6ACCD;">(</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">1000</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> </span><span style="color:#F78C6C;">8</span><span style="color:#A6ACCD;">) </span><span style="color:#676E95;font-style:italic;">// 512</span></span></code></pre></div><p>如果第二个参数不是数值，会被自动转为一个整数。这个整数只有在2到36之间，才能得到有意义的结果，超出这个范围，则返回<code>NaN</code>。如果第二个参数是<code>0</code>、<code>undefined</code>和<code>null</code>，则直接忽略。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;10&#39;, 37) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;10&#39;, 1) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;10&#39;, 0) // 10</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;10&#39;, null) // 10</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;10&#39;, undefined) // 10</span></span></code></pre></div><p>如果字符串包含对于指定进制无意义的字符，则从最高位开始，只返回可以转换的数值。如果最高位无法转换，则直接返回<code>NaN</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(&#39;1546&#39;, 2) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;546&#39;, 2) // NaN</span></span></code></pre></div><p>上面代码中，对于二进制来说，<code>1</code>是有意义的字符，<code>5</code>、<code>4</code>、<code>6</code>都是无意义的字符，所以第一行返回1，第二行返回<code>NaN</code>。</p><p>前面说过，如果<code>parseInt</code>的第一个参数不是字符串，会被先转为字符串。这会导致一些令人意外的结果。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(0x11, 36) // 43</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(0x11, 2) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(String(0x11), 36)</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(String(0x11), 2)</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;17&#39;, 36)</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(&#39;17&#39;, 2)</span></span></code></pre></div><p>上面代码中，十六进制的<code>0x11</code>会被先转为十进制的17，再转为字符串。然后，再用36进制或二进制解读字符串<code>17</code>，最后返回结果<code>43</code>和<code>1</code>。</p><p>这种处理方式，对于八进制的前缀0，尤其需要注意。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseInt(011, 2) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(String(011), 2)</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">parseInt(String(9), 2)</span></span></code></pre></div><p>上面代码中，第一行的<code>011</code>会被先转为字符串<code>9</code>，因为<code>9</code>不是二进制的有效字符，所以返回<code>NaN</code>。如果直接计算<code>parseInt(&#39;011&#39;, 2)</code>，<code>011</code>则是会被当作二进制处理，返回3。</p><p>JavaScript 不再允许将带有前缀0的数字视为八进制数，而是要求忽略这个<code>0</code>。但是，为了保证兼容性，大部分浏览器并没有部署这一条规定。</p><h3 id="_2-parsefloat" tabindex="-1">2.parseFloat() <a class="header-anchor" href="#_2-parsefloat" aria-label="Permalink to &quot;2.parseFloat()&quot;">​</a></h3><p><code>parseFloat</code>方法用于将一个字符串转为浮点数。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;3.14&#39;) // 3.14</span></span></code></pre></div><p>如果字符串符合科学计数法，则会进行相应的转换。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;314e-2&#39;) // 3.14</span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;0.0314E+2&#39;) // 3.14</span></span></code></pre></div><p>如果字符串包含不能转为浮点数的字符，则不再进行往后转换，返回已经转好的部分。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;3.14more non-digit characters&#39;) // 3.14</span></span></code></pre></div><p><code>parseFloat</code>方法会自动过滤字符串前导的空格。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;\\t\\v\\r12.34\\n &#39;) // 12.34</span></span></code></pre></div><p>如果参数不是字符串，或者字符串的第一个字符不能转化为浮点数，则返回<code>NaN</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat([]) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;FF2&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;&#39;) // NaN</span></span></code></pre></div><p>上面代码中，尤其值得注意，<code>parseFloat</code>会将空字符串转为<code>NaN</code>。</p><p>这些特点使得<code>parseFloat</code>的转换结果不同于<code>Number</code>函数。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">parseFloat(true)  // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">Number(true) // 1</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(null) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">Number(null) // 0</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;&#39;) // NaN</span></span>
<span class="line"><span style="color:#A6ACCD;">Number(&#39;&#39;) // 0</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">parseFloat(&#39;123.45#&#39;) // 123.45</span></span>
<span class="line"><span style="color:#A6ACCD;">Number(&#39;123.45#&#39;) // NaN</span></span></code></pre></div><h3 id="_3-isnan" tabindex="-1">3.isNaN() <a class="header-anchor" href="#_3-isnan" aria-label="Permalink to &quot;3.isNaN()&quot;">​</a></h3><p><code>isNaN</code>方法可以用来判断一个值是否为<code>NaN</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">isNaN(NaN) // true</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN(123) // false</span></span></code></pre></div><p>但是，<code>isNaN</code>只对数值有效，如果传入其他值，会被先转成数值。比如，传入字符串的时候，字符串会被先转成<code>NaN</code>，所以最后返回<code>true</code>，这一点要特别引起注意。也就是说，<code>isNaN</code>为<code>true</code>的值，有可能不是<code>NaN</code>，而是一个字符串。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">isNaN(&#39;Hello&#39;) // true</span></span>
<span class="line"><span style="color:#A6ACCD;">// 相当于</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN(Number(&#39;Hello&#39;)) // true</span></span></code></pre></div><p>出于同样的原因，对于对象和数组，<code>isNaN</code>也返回<code>true</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">isNaN({}) // true</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN(Number({})) // true</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN([&#39;xzy&#39;]) // true</span></span>
<span class="line"><span style="color:#A6ACCD;">// 等同于</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN(Number([&#39;xzy&#39;])) // true</span></span></code></pre></div><p>但是，对于空数组和只有一个数值成员的数组，<code>isNaN</code>返回<code>false</code>。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">isNaN([]) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN([123]) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isNaN([&#39;123&#39;]) // false</span></span></code></pre></div><p>上面代码之所以返回<code>false</code>，原因是这些数组能被<code>Number</code>函数转成数值，请参见《数据类型转换》一章。</p><p>因此，使用<code>isNaN</code>之前，最好判断一下数据类型。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">function myIsNaN(value) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  return typeof value === &#39;number&#39; &amp;&amp; isNaN(value);</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span></code></pre></div><p>判断<code>NaN</code>更可靠的方法是，利用<code>NaN</code>为唯一不等于自身的值的这个特点，进行判断。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">function myIsNaN(value) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  return value !== value;</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span></code></pre></div><h3 id="_4-isfinite" tabindex="-1">4.isFinite() <a class="header-anchor" href="#_4-isfinite" aria-label="Permalink to &quot;4.isFinite()&quot;">​</a></h3><p><code>isFinite</code>方法返回一个布尔值，表示某个值是否为正常的数值。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">isFinite(Infinity) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isFinite(-Infinity) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isFinite(NaN) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isFinite(undefined) // false</span></span>
<span class="line"><span style="color:#A6ACCD;">isFinite(null) // true</span></span>
<span class="line"><span style="color:#A6ACCD;">isFinite(-1) // true</span></span></code></pre></div><p>除了<code>Infinity</code>、<code>-Infinity</code>、<code>NaN</code>和<code>undefined</code>这几个值会返回<code>false</code>，<code>isFinite</code>对于其他的数值都会返回<code>true</code>。</p><h2 id="六、字符串" tabindex="-1">六、字符串 <a class="header-anchor" href="#六、字符串" aria-label="Permalink to &quot;六、字符串&quot;">​</a></h2><p>​ 1.定义：</p><p>​ 零个或多个排在一起的字符，放在单引号或多引号之中。单双引号可以在内部相互使用。</p><p>​ 如果要在单引号字符串的内部，使用单引号，就必须在内部的单引号前面加上反斜杠，用来转义。双引号字符串内部使用双引号，也是如此。</p><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">Did she say </span><span style="color:#A6ACCD;">\\&#39;</span><span style="color:#C3E88D;">Hello</span><span style="color:#A6ACCD;">\\&#39;</span><span style="color:#C3E88D;">?</span><span style="color:#89DDFF;">&#39;</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// &quot;Did she say &#39;Hello&#39;?&quot;</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">Did she say </span><span style="color:#A6ACCD;">\\&quot;</span><span style="color:#C3E88D;">Hello</span><span style="color:#A6ACCD;">\\&quot;</span><span style="color:#C3E88D;">?</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"><span style="color:#676E95;font-style:italic;">// &quot;Did she say &quot;Hello&quot;?&quot;</span></span></code></pre></div><p>​ 默认只能写在一行内，分成多行将会报错。</p><p>​ 如果长字符串必须分成多行，可以在每一行的尾部使用反斜杠。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var longString = &#39;Long \\</span></span>
<span class="line"><span style="color:#A6ACCD;">long \\</span></span>
<span class="line"><span style="color:#A6ACCD;">long \\</span></span>
<span class="line"><span style="color:#A6ACCD;">string&#39;;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">longString</span></span>
<span class="line"><span style="color:#A6ACCD;">// &quot;Long long long string&quot;</span></span></code></pre></div><p>连接运算符（<code>+</code>）可以连接多个单行字符串，将长字符串拆成多行书写，输出的时候也是单行。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var longString = &#39;Long &#39;</span></span>
<span class="line"><span style="color:#A6ACCD;">  + &#39;long &#39;</span></span>
<span class="line"><span style="color:#A6ACCD;">  + &#39;long &#39;</span></span>
<span class="line"><span style="color:#A6ACCD;">  + &#39;string&#39;;</span></span></code></pre></div><p>如果想输出多行字符串，有一种利用多行注释的变通方法。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">(function () { /*</span></span>
<span class="line"><span style="color:#A6ACCD;">line 1</span></span>
<span class="line"><span style="color:#A6ACCD;">line 2</span></span>
<span class="line"><span style="color:#A6ACCD;">line 3</span></span>
<span class="line"><span style="color:#A6ACCD;">*/}).toString().split(&#39;\\n&#39;).slice(1, -1).join(&#39;\\n&#39;)</span></span>
<span class="line"><span style="color:#A6ACCD;">// &quot;line 1</span></span>
<span class="line"><span style="color:#A6ACCD;">// line 2</span></span>
<span class="line"><span style="color:#A6ACCD;">// line 3&quot;</span></span></code></pre></div><p>上面的例子中，输出的字符串就是多行。</p><p>​ 2.转义</p><p>​ 反斜杠（\\）在字符串内有特殊含义，用来表示一些特殊字符，所以又称为转义符。</p><p>需要用反斜杠转义的特殊字符，主要有下面这些。</p><ul><li><code>\\0</code> ：null（<code>\\u0000</code>）</li><li><code>\\b</code> ：后退键（<code>\\u0008</code>）</li><li><code>\\f</code> ：换页符（<code>\\u000C</code>）</li><li><code>\\n</code> ：换行符（<code>\\u000A</code>）</li><li><code>\\r</code> ：回车键（<code>\\u000D</code>）</li><li><code>\\t</code> ：制表符（<code>\\u0009</code>）</li><li><code>\\v</code> ：垂直制表符（<code>\\u000B</code>）</li><li><code>\\&#39;</code> ：单引号（<code>\\u0027</code>）</li><li><code>\\&quot;</code> ：双引号（<code>\\u0022</code>）</li><li><code>\\\\</code> ：反斜杠（<code>\\u005C</code>）</li></ul><p>上面这些字符前面加上反斜杠，都表示特殊含义。</p><p><code>如果在非特殊字符前面使用反斜杠，则反斜杠会被省略</code>。</p><p>3.字符串与数组</p><p>​ 字符串可以看成字符数组，因此可以使用数组的运算符号。</p><p>​ 但是，字符串与数组的相似性仅此而已。实际上，无法改变字符串之中的单个字符。</p><div class="language-javascript"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#C792EA;">var</span><span style="color:#A6ACCD;"> s </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">hello</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">;</span></span>
<span class="line"></span>
<span class="line"><span style="color:#89DDFF;">delete</span><span style="color:#A6ACCD;"> s[</span><span style="color:#F78C6C;">0</span><span style="color:#A6ACCD;">]</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">s </span><span style="color:#676E95;font-style:italic;">// &quot;hello&quot;</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">s[</span><span style="color:#F78C6C;">1</span><span style="color:#A6ACCD;">] </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">a</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">s </span><span style="color:#676E95;font-style:italic;">// &quot;hello&quot;</span></span>
<span class="line"></span>
<span class="line"><span style="color:#A6ACCD;">s[</span><span style="color:#F78C6C;">5</span><span style="color:#A6ACCD;">] </span><span style="color:#89DDFF;">=</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">!</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">;</span></span>
<span class="line"><span style="color:#A6ACCD;">s </span><span style="color:#676E95;font-style:italic;">// &quot;hello&quot;</span></span></code></pre></div><pre><code>	### length属性
</code></pre><p>​ 属性返回字符串的长度，该属性也是无法改变的。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var s = &#39;hello&#39;;</span></span>
<span class="line"><span style="color:#A6ACCD;">s.length // 5</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">s.length = 3;</span></span>
<span class="line"><span style="color:#A6ACCD;">s.length // 5</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">s.length = 7;</span></span>
<span class="line"><span style="color:#A6ACCD;">s.length // 5</span></span></code></pre></div><h3 id="字符集" tabindex="-1">字符集 <a class="header-anchor" href="#字符集" aria-label="Permalink to &quot;字符集&quot;">​</a></h3><p>JavaScript 使用 Unicode 字符集。JavaScript 引擎内部，所有字符都用 Unicode 表示。</p><h3 id="base64转码" tabindex="-1">Base64转码 <a class="header-anchor" href="#base64转码" aria-label="Permalink to &quot;Base64转码&quot;">​</a></h3><p>有时，文本里面包含一些不可打印的符号，比如 ASCII 码0到31的符号都无法打印出来，这时可以使用 Base64 编码，将它们转成可以打印的字符。另一个场景是，有时需要以文本格式传递二进制数据，那么也可以使用 Base64 编码。</p><p>所谓 Base64 就是一种编码方法，可以将任意值转成 0～9、A～Z、a-z、<code>+</code>和<code>/</code>这64个字符组成的可打印字符。使用它的主要目的，不是为了加密，而是为了不出现特殊字符，简化程序的处理。</p><p>JavaScript 原生提供两个 Base64 相关的方法。</p><ul><li><code>btoa()</code>：任意值转为 Base64 编码</li><li><code>atob()</code>：Base64 编码转为原来的值</li></ul><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var string = &#39;Hello World!&#39;;</span></span>
<span class="line"><span style="color:#A6ACCD;">btoa(string) // &quot;SGVsbG8gV29ybGQh&quot;</span></span>
<span class="line"><span style="color:#A6ACCD;">atob(&#39;SGVsbG8gV29ybGQh&#39;) // &quot;Hello World!&quot;</span></span></code></pre></div><p>注意，这两个方法不适合非 ASCII 码的字符，会报错。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">btoa(&#39;你好&#39;) // 报错</span></span></code></pre></div><p>要将非 ASCII 码字符转为 Base64 编码，必须中间插入一个转码环节，再使用这两个方法。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">function b64Encode(str) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  return btoa(encodeURIComponent(str));</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">function b64Decode(str) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  return decodeURIComponent(atob(str));</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">b64Encode(&#39;你好&#39;) // &quot;JUU0JUJEJUEwJUU1JUE1JUJE&quot;</span></span>
<span class="line"><span style="color:#A6ACCD;">b64Decode(&#39;JUU0JUJEJUEwJUU1JUE1JUJE&#39;) // &quot;你好&quot;</span></span></code></pre></div><h2 id="七、对象" tabindex="-1">七、对象 <a class="header-anchor" href="#七、对象" aria-label="Permalink to &quot;七、对象&quot;">​</a></h2><pre><code>	### 1.对象的表达
</code></pre><p>​ 对象(object)是JavaScript语言的核心概念，也是最重要的数据类型。</p><p>对象：就是一组“键值对”(key-value)的集合，无序的复合数据集合。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var obj = {</span></span>
<span class="line"><span style="color:#A6ACCD;">  foo: &#39;Hello&#39;,</span></span>
<span class="line"><span style="color:#A6ACCD;">  bar: &#39;World&#39;</span></span>
<span class="line"><span style="color:#A6ACCD;">};</span></span></code></pre></div><p>注1：因为是键值对，故所有的键名都是字符串(es6中加入了Symbol也可以作为键名)。</p><p>注2：如果键名不符合标识名的条件（比如第一个字符为数字，或者含有空格或运算符），且也不是数字，则必须加上引号，否则会报错。</p><p>注3：对象的每一个键名又称为“属性”（property），它的“键值”可以是任何数据类型。如果一个属性的值为函数，通常把这个属性称为“方法”，它可以像函数那样调用。</p><p>注4：如果要解释为对象，最好在大括号前加上圆括号。因为圆括号的里面，只能是表达式，所以确保大括号只能解释为对象。</p><pre><code>	### 2.属性的操作
</code></pre><p>​ 读取对象的属性，有两种方法，一种是使用点运算符，还有一种是使用方括号运算符。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var foo = &#39;bar&#39;;</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">var obj = {</span></span>
<span class="line"><span style="color:#A6ACCD;">  foo: 1,</span></span>
<span class="line"><span style="color:#A6ACCD;">  bar: 2</span></span>
<span class="line"><span style="color:#A6ACCD;">};</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">obj.foo  // 1</span></span>
<span class="line"><span style="color:#A6ACCD;">obj[foo]  // 2</span></span></code></pre></div><p>注1：查看一个对象本身的所有属性，可以使用<code>Object.keys</code>方法。</p><p>注2：<code>delete</code>命令用于删除对象的属性，删除成功后返回<code>true</code>。另外，需要注意的是，<code>delete</code>命令只能删除对象本身的属性，无法删除继承的属性。</p><p>注3：<code>in</code>运算符用于检查对象是否包含某个属性（注意，检查的是键名，不是键值），如果包含就返回<code>true</code>，否则返回<code>false</code>。它的左边是一个字符串，表示属性名，右边是一个对象。</p><p>注4：<code>for...in</code>循环用来遍历一个对象的全部属性。</p><ul><li>它遍历的是对象所有可遍历（enumerable）的属性，会跳过不可遍历的属性。</li><li>它不仅遍历对象自身的属性，还遍历继承的属性。</li></ul><h2 id="八、函数" tabindex="-1">八、函数 <a class="header-anchor" href="#八、函数" aria-label="Permalink to &quot;八、函数&quot;">​</a></h2><h3 id="_1-函数的声明" tabindex="-1">1.函数的声明 <a class="header-anchor" href="#_1-函数的声明" aria-label="Permalink to &quot;1.函数的声明&quot;">​</a></h3><p>1）function 命令</p><p>​ function 声明的代码区块就是一个函数。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">function print(s) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  console.log(s);</span></span>
<span class="line"><span style="color:#A6ACCD;">}</span></span></code></pre></div><p>上面的代码命名了一个<code>print</code>函数，以后使用<code>print()</code>这种形式，就可以调用相应的代码。这叫做函数的声明（Function Declaration）。</p><p>2）函数表达式</p><p>​ 除了function还可以命令声明函数，还可以采用变量赋值的写法。</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">var print = function(s) {</span></span>
<span class="line"><span style="color:#A6ACCD;">  console.log(s);</span></span>
<span class="line"><span style="color:#A6ACCD;">};</span></span></code></pre></div><p>采用函数表达式声明函数时，<code>function</code>命令后面不带有函数名。如果加上函数名，该函数名只在函数体内部有效，在函数体外部无效。</p>`,156),o=[p];function c(t,i,r,d,C,A){return n(),a("div",null,o)}const u=s(e,[["render",c]]);export{D as __pageData,u as default};
